        public float GetBoneCurveEvaluateI( int boneIndex, BoneCurveType type, float f ){
            return GetBoneCurveEvaluateLinearComplement( BoneNames[boneIndex], type, f, dicCurveRuntime  );
//            return GetBoneCurveEvaluate( BoneNames[boneIndex], type, f, dicCurveRuntime ); // 似た結果になるが少しズレる
        }

        readonly float [] animKeyTimes = new float[] {0f, 0.041666668f, 0.083333336f, 0.125f, 0.16666667f, 0.20833333f, 0.25f, 0.29166666f, 0.33333334f, 0.375f, 0.41666666f, 0.45833334f, 0.5f, 0.5416667f, 0.5833333f, 0.625f, 0.6666667f, 0.7083333f, 0.75f, 0.7916667f, 0.8333333f, 0.875f, 0.9166667f, 0.9583333f, 1f };

        public float GetBoneCurveEvaluateLinearComplement( string boneName, BoneCurveType type, float f, Dictionary<string, BoneCurves> dic)
        {
            if (f > 0.9583333f) {
				return GetBoneCurveEvaluate( boneName, type, animKeyTimes[animKeyTimes.Length - 1], dic);
			}
            if (f < 0.0f) f = 0.0f;
            float ret = 0f;
            for ( int i = 0; i < animKeyTimes.Length - 1; i++ ) {
                if ( (f >= animKeyTimes[i] && f < animKeyTimes[i+1]) || i == animKeyTimes.Length - 1 ) {
                    float rf1 = GetBoneCurveEvaluate( boneName, type, animKeyTimes[i], dic); // KeyFrame
                    float rf2 = GetBoneCurveEvaluate( boneName, type, animKeyTimes[i+1], dic); // KeyFrame
                    ret = rf1 + ((rf2-rf1) * (f-animKeyTimes[i])/(animKeyTimes[i+1]-animKeyTimes[i])); // Linear Complement
                    break;
                }
            }
            return ret;
        }

        public float GetBoneCurveEvaluate( string boneName, BoneCurveType type, float f, Dictionary<string, BoneCurves> dic){
            if ( dic.ContainsKey(boneName) == false ) {
                Debug.LogError("GetBoneCurveEvaluate: invalid BoneName. : " + boneName);
                return 0.0f;
            }
            BoneCurves bc = dic[boneName];
            if ( bc == null ) {
                Debug.LogError("GetBoneCurveEvaluate: Bone Curves Not Found. : " + boneName );
                return 0.0f;
            }

            AnimationCurve curve = null;
            curve = dic[boneName]._curves[(int)type];
            if ( curve == null ) {
                Debug.LogError("GetBoneCurveEvaluate: Curve Not Found. : " + boneName );
                return 0.0f;
            }

            float eval = curve.Evaluate(f);
            //Debug.Log("eval done: " + boneName + "/" + type.ToString() + ", f: " + f.ToString() + " to " + eval.ToString() );
            return eval;
        }

